import React from "react";
import classes from "./AboutMEStyles.module.css";

export const AboutME = () => {
    return (
        <div className={classes.content}>
            <h1>Skills</h1>
            <div className={classes.skills}>
                <div className={classes.threeD}>
                    <h2>3D</h2>
                    <p></p>
                </div>
                <div className={classes.twoD}>
                    <h2>2D</h2>
                </div>
            </div>
        </div>
    );
};
